// Header.js
import React from 'react';
import { Link } from 'react-router-dom';

const Header = ({ wishlist, cart, user, setUser }) => {
    const handleLogout = () => {
        setUser(null);
        // Add any additional logout logic here if needed
    };

    const [isOpen, setIsOpen] = useState(false);

    const toggleDropdown = () => {
        setIsOpen(!isOpen);
    };

    const handleLinkClick = () => {
        setIsOpen(false); // Close dropdown on link click
    };

    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div className="container p-3">
                <Link className="navbar-brand" to="/">
                    <img src='./' alt='logo' />
                </Link>
                <button
                    className="navbar-toggler"
                    type="button"
                    data-bs-toggle="collapse"
                    data-bs-target="#navbarNav"
                    aria-controls="navbarNav"
                    aria-expanded="false"
                    aria-label="Toggle navigation"
                >
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav ms-auto">
                        <li className="nav-item dropdown">
                            <Link
                                className="nav-link dropdown-toggle font-weight-bold"
                                to="/product"
                                id="shopDropdown"
                                role="button"
                                data-bs-toggle="dropdown"
                                aria-expanded="false"
                            >
                                Shop
                            </Link>
                            <ul className="dropdown-menu" aria-labelledby="shopDropdown">
                                <li><Link className="dropdown-item" to="/shop/electronics">Electronics</Link></li>
                                <li><Link className="dropdown-item" to="/shop/jewelery">Jewelery</Link></li>
                                <li><Link className="dropdown-item" to="/shop/men's-clothing">Men's Clothing</Link></li>
                                <li><Link className="dropdown-item" to="/shop/women's-clothing">Women's Clothing</Link></li>
                            </ul>
                        </li>

                        <li className="nav-item">
                            <Link className="nav-link" to="/wishlist">
                                <i className="fas fa-heart"></i>
                                {wishlist.length > 0 && (
                                    <span className="badge bg-danger ms-1">{wishlist.length}</span>
                                )}
                            </Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/cart">
                                <i className="fas fa-shopping-cart"></i>
                                {cart.length > 0 && (
                                    <span className="badge bg-danger ms-1">{cart.length}</span>
                                )}
                            </Link>
                        </li>

                        {/* Conditional Rendering for Login/Logout */}
                        {user ? (
                            <li className="nav-item">
                                <span className="nav-link">Welcome, {user.username}</span>
                                <button onClick={handleLogout} className="btn btn-link nav-link">
                                    Logout
                                </button>
                            </li>
                        ) : (
                            <li className="nav-item">
                                <Link className="nav-link" to="/login">
                                    <i className="fas fa-user"></i> Login
                                </Link>
                            </li>
                        )}
                        <li className="nav-item">
                            <Link className="btn btn-outline-primary" to="/register">
                                Register
                            </Link>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
    );
};

export default Header;
